     String,                           // 列表的高度，直接设置为style，所以需要带单位\r\n       * tableWidth:      String,                           // 左右穿梭框的宽度，直接设置为style，所以需要带单位\r\n       * disabled:        Function                          // 在selectEnable的基础之上，对左右穿梭框某些选项的disabled限制，使其不能左右穿梭，函数参数是该行数据row\r\n       * }}\r\n       */\r\n      default: function(){\r\n        return {\r\n          ajaxLeft: {},\r\n          uniqueKey: "",\r\n          dataLeft: [],\r\n          showHeader: true,\r\n          height: "500px",\r\n          tableWidth: "200px",\r\n          disabled: null,\r\n        }\r\n      }\r\n\r\n    },\r\n    disabled: {\r\n      type: Boolean,\r\n      default: false,\r\n    },\r\n  },\r\n  mounted(){\r\n    // 基本样式默认值\r\n    !this.config.height&&(this.config.height="500px")\r\n    !this.config.tableWidth&&(this.config.tableWidth="200px")\r\n    // 获取类名定宽\r\n    this.$nextTick(()=>{\r\n      document.getElementsByClassName("transfer-item")[0].style.width = this.config.tableWidth\r\n      document.getElementsByClassName("transfer-item")[1].style.width = this.config.tableWidth\r\n      // console.log(document.getElementsByClassName("transfer-item")[0].style.width,this.config.tableWidth,this.$props,this.props)\r\n    })\r\n  },\r\n  data(){\r\n    return {\r\n\r\n        // selection左右独立\r\n        // 实时selection\r\n        selectionLeft:[],\r\n        selectionRight:[],\r\n        // 点击移入/移出后进入锁定状态的selection，用来确定最终的数据转移以及决定dict的值\r\n        // 由于lockedRight来源于lockedLeft，所以左边的列表使用lockRight来绑定，实时的selection则由selectionRight存储，并在unload方法后，将lockedRight同步为selectionRight\r\n        selectionLockedLeft:[],\r\n        selectionLockedRight:[],\r\n        // locked的字典，以uniqueKey的值为键名，用来判断是否存在\r\n        dictLeft:{},\r\n        dictRight:{},\r\n        pagechanged:false,\r\n    }\r\n  },\r\n  methods: {\r\n    // utils\r\n    // 获取核心的el-table组件实例\r\n    getCore(ref) {\r\n      switch(ref) {\r\n        case \'transferItemLeft\':\r\n        return this.$refs[ref].$refs["bdaScroll